    false,nt"url": null,nt"notes": "This narrative report for Kulm Wetland
    Management District outlines Refuge accomplishments during the 1980 calendar year.
    The report begins with an introduction to the Refuge and information about weather
    conditions, habitat conditions, land acquisition activities, and the system status.
    Construction, maintenance, and wildfires are also described. Habitat management
    is covered; croplands, grasslands, wetlands, forests, and easements for waterfowl
    management are discussed. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreation, and law enforcement. Field investigations, items of interest, and safety
    information are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
